import React from 'react'
import Room from './Rooms';

export default function RoomsList({sortedRooms}) {
    return (
        <div className="room-list">
            {sortedRooms.map((item, index)=>{
                <Room id={index} room={item} className="room-list-centered"></Room>
            })}
        </div>
    )
}
